import React from 'react';
import styles from './Home.module.css';
const Home = () => {
  return (
    <div>
      <h1>Home</h1>
      <div className={styles.card}>
        <p>Rent</p>
        <p>$120</p>
        <p>Due 12 June 2022</p>
      </div>
    </div>
  );
};

export default Home;
